import React, { Component } from "react";
const getNum = () => {
  return Math.floor(Math.random() * 10);
};
class NumPicker extends Component {
  render() {
    return (
      <div>
        <h1>Your num is...{}</h1>
        <p>{getNum}</p>
      </div>
    );
  }
}
export default NumPicker;
